import React, { Component } from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';
import {ReactComponent as HomeIcon} from '../images/home-simple.svg';
import { LocationForm } from './LocationForm';

var service;

const mapStyles = {
  width: '90%',
  height: '100%'
};

export class MapContainer extends Component {
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={14}
        style={mapStyles}
        initialCenter={
          {
            lat: -1.2884,
            lng: 36.8233
          }
        }
      />
    );
  }
}

var service = new google.maps.place.PlacesService(MapContainer)

service.findPlaceFromQuery(LocationForm, function(results, status) {
  if (status === google.maps.places.PlacesServiceStatus.OK) {
    for (var i = 0; i < results.length; i++) {
      createMarker(results[i]);
    }
    Map.setCenter(results[0].geometry.location);
  }
});

export default GoogleApiWrapper({
  apiKey: 'AIzaSyC35W7xvQG9VYdM5xhS4SwypWt8ebGI9yA'
})(MapContainer);
